import * as React from 'react';
import paperClasses from '@mui/material/Paper';
import {
  Scheduler,
  DayView,
  Appointments,
  AppointmentTooltip,
} from '@devexpress/dx-react-scheduler-material-ui';

import appointments from '../data/today-appointments';

export default () => (
  <Paper>
    <Scheduler
      data={appointments}
    >
      <DayView
        startDayHour={8}
        endDayHour={13}
      />
      <Appointments />
      <AppointmentTooltip />
    </Scheduler>
  </Paper>
);
